import React, { useState } from "react";

export default function AdminML() {
  const [training, setTraining] = useState(false);
  const [lastRun, setLastRun] = useState(null);
  const [accuracy, setAccuracy] = useState(null);
  const [loss, setLoss] = useState(null);
  const [topPreferences, setTopPreferences] = useState([]);

  const startTraining = () => {
    setTraining(true);

    fetch("http://localhost:5000/api/ml/train", { method: "POST" })
      .then(res => res.json())
      .then(data => {
        setTraining(false);
        setLastRun(new Date().toLocaleString());
        if (data.success) {
          setAccuracy(data.accuracy);
          setLoss(data.loss);
          setTopPreferences(data.topPreferences || []);
        }
      })
      .catch(err => {
        console.error(err);
        setTraining(false);
      });
  };

  return (
    <div style={{ marginLeft: 220, padding: 20 }}>
      <h2>ML Module</h2>
      <button onClick={startTraining} disabled={training}>
        {training ? "Training..." : "Train Model"}
      </button>

      {lastRun && <p>Last trained: {lastRun}</p>}
      {accuracy !== null && <p>Accuracy: {(accuracy * 100).toFixed(2)}%</p>}
      {loss !== null && <p>Loss: {loss.toFixed(4)}</p>}

      {topPreferences.length > 0 ? (
        <div>
          <p>Top Preferences:</p>
          <ol>
            {topPreferences.map((pref, i) => <li key={i}>{pref}</li>)}
          </ol>
        </div>
      ) : (
        <p>No preferences found.</p>
      )}
    </div>
  );
}
